import styles from './AccountPage.module.css'


class AccountPage extends Component {
    render() {
        return (
            <div>
<div className={styles.welcomeMessage}>
                <span  >
                    Hello! This is the Account Page.
                </span>
            </div>
            </div>
            

        );
    }
}

export default AccountPage
